import { useEffect } from "react";
import $ from "jquery";

export default function Header() {
  useEffect(() => {
    const handleToggle = () => {
      $("#toggle").toggleClass("on");
      $("#menu").slideToggle();
    };

    $("#toggle").on("click", handleToggle);

    return () => {
      $("#toggle").off("click", handleToggle);
    };
  }, []);

  useEffect(() => {
    // Close the menu on component mount
    $("#menu").hide();
  }, []);

  return (
    <header>
      <nav>
        <div
          id="toggle"
          //   onClick={handleToggle}
          //   className={isMenuOpen ? "on" : ""}
        >
          <div class="one"></div>
          <div class="two"></div>
          <div class="three"></div>
        </div>

        <div id="menu">Hello, I'm a menu!</div>
      </nav>
    </header>
  );
}
